package bondisuy.action.external.dto;

public class PuntoDTO {
	Double x;
	Double y;
	
	
	public PuntoDTO() {
	}


	public PuntoDTO(Double x, Double y) {
		this.x = x;
		this.y = y;
	}


	public Double getX() {
		return x;
	}


	public void setX(Double x) {
		this.x = x;
	}


	public Double getY() {
		return y;
	}


	public void setY(Double y) {
		this.y = y;
	}

	
	
}
